【商品説明】<br>
★本品は、大麦若葉を水洗いして、乾燥、滅菌、<br>微粉未加工した100%の純粉末です。大麦若葉は<br>青汁の中でも、匂いや味にくせがなくお抹茶のような<br>味です。<br>
★生野菜に比べ簡単便利な100%野菜素材で各種元素が
<br>パワフルに含まれ、健康に役立つ魅力がある青汁です。<br>
【原材料名】　大麦若葉粉末<br>
【内容量】　170ｇ<br>
【お召し上がり方】<br> 
「大麦若葉粉末100％  170g」は、通常の<br>食生活において、1日に1-2パックを目安にお召し上がりください。<br>
水又は牛乳約100ccの中へ、1パック（3g）の中味を入れ、<br>スプーンにて、すばやく、よくかき混ぜてお召し上がりください。<br>
● お好みにより量を加減してください。<br>
●生ものですので、つくりおきしないでください。<br>
●冷たいお水又は牛乳にいれてお飲みになりますと<br>いっそうおいしくなります。<br>
●粉末を直接口に入れますとのどに詰まることが<br>ありますので、おやめください。<br>
●本品1日量（1-2パック）のご使用で緑黄色野菜摂取の<br>補助となりますが、1日の目標摂取量を補える訳では<br>ございません。<br>
 <br>
