【商品説明】<br>
★本品はケールをそのまま乾燥、微粉末加工した<br>100％の純粉末です。<br>
★ケールは、匂いや味にくせが少なく、<br>ほど良い味わいの青汁です。<br>
★青野菜を補給して、健康維持を心がける方に<br>お役立て下さい。<br>
【内容量】　170g<br>
【お召し上がり方】<br>
1日1～2回を目安にお召し上がりください。<br>まず、牛乳又は水約100ccの中へ、1回に添付のさじ<br>山盛り2杯（約2.5g～3.0g）を入れ、スプーン又は<br>マドラーなどでよくかきまぜてお召し上がりください。<br>氷を入れていただいてもかまいません。<br>
<br>
